class Node:
    r"""Node class for search tree
    Args:
        parent (Node): the parent node of this node in the tree
        act (Action): the action taken from parent to reach this node
        state (State): the state of this node
        cost (float): the path cost of reaching this state
    """
    
    def __init__(
            self, 
            parent: "Node", 
            act, 
            state, 
            cost: float = 0.0):

        self.parent = parent # where am I from
        self.act = act # how to get here
        self.state = state # who am I
        self.cost = cost # what it costs to be here

    def __str__(self):
        return str(self.state)

    def __lt__(self, node):
        """Compare the path cost between states"""
        return self.cost < node.cost

    def __eq__(self, node):
        if not isinstance(node, Node):
            return False
        return True

    def __hash__(self):
        """Hash based on agent position"""
        return hash((pos[0], pos[1]))

class PriorityQueue:
    def __init__(self):
        self.heap = []

    def __contains__(self, node):
        """Decide whether the node (state) is in the queue"""
        return any([item == node for _, item in self.heap])

    def __delitem__(self, node):
        """Delete the an existing node in the queue"""
        try: 
            del self.heap[[item == node for _, item in self.heap].index(True)]
        except ValueError:
            raise KeyError(str(node) + " is not in the queue")
        heapq.heapify(self.heap) # O(n)

    def __getitem__(self, node):
        """Return the priority of the given node in the queue"""
        for value, item in self.heap:
            if item == node:
                return value
        raise KeyError(str(node) + " is not in the queue")

    def __len__(self):
        return len(self.heap)

    def __repr__(self):
        string = '['
        for priority, node in self.heap:
            string += f"({priority}, {node}), "
        string += ']'
        return string

    def push(self, priority, node):
        """Enqueue node with priority"""
        heapq.heappush(self.heap, (priority, node))

    def pop(self):
        """Dequeue node with highest priority (the minimum one)"""
        if self.heap:
            return heapq.heappop(self.heap)[1]
        else:
            raise Exception("Empty priority queue")

    def get_priority(self, node):
        return self.__getitem__(node)


class Astar():
    def __init__(self):
        self.ACTION = {
            (0, -1): GUAction.UP,
            (0, 1): GUAction.DOWN,
            (-1, 0): GUAction.LEFT,
            (1, 0): GUAction.RIGHT,
        }
        
    
    def get_agent_position_from_level_repr(self, level) -> Tuple[int, int]:
        # try to get your (the agent's) position from the Level representation by traversing the grid
        for y in range(level.height):
            for x in range(level.width):
                for obj in level.grid[y][x]:
                    if getattr(obj, 'agent', None):
                        return (x, y)
        

    def get_agent_position_from_state_repr(self, state) -> Tuple[int, int]:
        # Now, try to get your (the agent's) position from the State representation by reading the position of the agent
        # Hint: `agent_id` has already been defined
        agent_id = next(iter(state.agent.keys()))
        curr_pos = state.position[agent_id]
        return (curr_pos.x, curr_pos.y)
        

    # Now, do the same thing for exit
    def get_exit_position_from_level_repr(self, level) -> Tuple[int, int]:
        for y in range(level.height):
            for x in range(level.width):
                for obj in level.grid[y][x]:
                    if getattr(obj, 'exit', None):
                        return (x, y)
                       
                
    def get_exit_position_from_state_repr(self, state) -> Tuple[int, int]:
        for eid in state.exit.keys():
            pos = state.position[eid]
            return (pos.x, pos.y)
        

    def get_key_position_from_state_repr(self, state) -> Tuple[int, int]:
        for kid in state.key.keys():
            pos = state.position[kid]
            return (pos.x, pos.y)
        
    def get_core_position_from_state_repr(self, state) -> List[Tuple[int, int]]:
        cores = []
        if len(state.required) > 0:  # Check if there are any cores left
            for kid in state.required.keys():
                pos = state.position[kid]
                if pos:  # Also check if position exists
                    cores.append((pos.x, pos.y))
        return cores

    def shortest_core_distance(self, state, cores) -> Tuple[Optional[Tuple[int, int]], Optional[List[GUAction]], State]:  
        shortest_score = float('-inf')
        shortest_path = None
        shortest_state = state
        closest_core = None
        for i in cores:
            curr_pos = self.get_agent_position_from_state_repr(state)

            core_path = self.astar_search(state, curr_pos, i, False)
            if core_path is None:
                return None, None, state
            core_path.append(GUAction.PICK_UP)
            temp_state = state
            agent_id = next(iter(temp_state.agent.keys()))
            for a in core_path:
                temp_state = step(temp_state, a, agent_id)
            score = temp_state.score
            if score >= shortest_score:
                closest_core = i
                shortest_path = core_path
                shortest_state = temp_state
                shortest_score = score

        return closest_core, shortest_path, shortest_state
    
    def get_box_positions(self, state) -> frozenset[Tuple[int, int]]:
        boxes = []
        for entity_id in state.pushable.keys():
            pos = state.position.get(entity_id)
            if pos:
                boxes.append((pos.x, pos.y))
        return frozenset(boxes)
    
    def get_enemy_positions(self, state) -> frozenset[Tuple[int, int]]:
        enemies = []
        for entity_id in state.moving.keys():
            pos = state.position.get(entity_id)
            if pos:
                enemies.append((pos.x, pos.y))
        return frozenset(enemies)
    
    def manhattan(self, a: Tuple[int,int], b: Tuple[int,int]) -> int:
        return abs(a[0]-b[0]) + abs(a[1]-b[1])

    def is_blocked(self, state, pos: Tuple[int, int]) -> bool:
        x, y = pos
        
        # Check bounds
        if not (0 <= x < state.width and 0 <= y < state.height):
            return True
        
        for entity_id in state.blocking.keys():
            entity_pos = state.position.get(entity_id)
            if entity_pos and entity_pos.x == x and entity_pos.y == y:
                if not entity_id in state.pushable.keys():
                    return not entity_id in state.pushable.keys()
               
        return False
    
    def is_pushable(self, state, pos: Tuple[int, int], dir: Tuple[int, int]) -> bool:
        x, y = pos
        # Check if pushable
        dirx, diry = dir
        has_pushable_box = False
        for entity_id in state.pushable.keys():
            entity_pos = state.position.get(entity_id)
            if entity_pos and entity_pos.x == x and entity_pos.y == y:
                has_pushable_box = True
                break

        if not has_pushable_box:
            return True
        new_box_x = x + dirx
        new_box_y = y + diry
    
        # Check bounds
        if not (0 <= new_box_x < state.width and 0 <= new_box_y < state.height):
            return False  
        
        for eid in state.blocking.keys():
            posi = state.position.get(eid)
            if posi and posi.x == new_box_x and posi.y == new_box_y:
                return False
        return True
    
    def powerup_stats(self, state) -> List[Tuple[str, int, int, int]]: #(Name, eid, time, use)
        power_list = []
        if getattr(state, "immunity", None):
            for eid in state.immunity.keys():
                pos = state.position.get(eid)
                if pos is None:
                    timelim = state.time_limit.get(eid)
                    if timelim:
                        timelim = timelim.amount
                    uselim = state.usage_limit.get(eid)
                    if uselim:
                        uselim = uselim.amount
                    if timelim == 0 or uselim == 0:
                        continue
                    else:
                        power_list.append(("immunity", eid, timelim, uselim))

        elif getattr(state, "phasing", None):
            for eid in state.phasing.keys():
                pos = state.position.get(eid)
                if pos is None:
                    timelim = state.time_limit.get(eid)
                    if timelim:
                        timelim = timelim.amount
                    uselim = state.usage_limit.get(eid)
                    if uselim:
                        uselim = uselim.amount
                    if timelim == 0 or uselim == 0:
                        continue
                    else:   
                        power_list.append(("phasing", eid, timelim, uselim))
        elif getattr(state, "speed", None):
            for eid in state.speed.keys():
                pos = state.position.get(eid)
                if pos is None:
                    timelim = state.time_limit.get(eid)
                    if timelim:
                        timelim = timelim.amount
                    uselim = state.usage_limit.get(eid)
                    if uselim:
                        uselim = uselim.amount
                    if timelim == 0 or uselim == 0:
                        continue
                    else:
                        power_list.append(("speed", eid, timelim, uselim))
        return power_list
    
    def expand(self, level_or_state, node):
        curr_state = node.state if node.state else level_or_state
        agent_id = next(iter(curr_state.agent.keys()))
        curr_pos = self.get_agent_position_from_state_repr(curr_state)
        can_phase, can_speed, can_immune = False, False, False
        active_powerups = self.powerup_stats(curr_state)

        for power in active_powerups:
            if power[0] == "phasing":
                can_phase = True
            elif power[0] == "speed":
                can_speed = True
        
        for health_obj in curr_state.health.values():
            curr_h = health_obj.health  # current health

        # Try USE_KEY action
        next_state = step(curr_state, GUAction.USE_KEY, agent_id)
        for health_obj in next_state.health.values():
            next_h = health_obj.health  # current health
        if next_state != curr_state:
            for entity_id in curr_state.inventory[agent_id].item_ids:
                if entity_id in curr_state.key.keys():
                    score_change = next_state.score - curr_state.score - (next_h - curr_h) * 1.2
    
                    child = Node(
                        parent=node,
                        act=GUAction.USE_KEY,
                        state=next_state,
                        cost = node.cost + (-score_change) + 4.5
                    )   
                    yield child
        
        # Try WAIT action
        next_state = step(curr_state, GUAction.WAIT, agent_id)
        for health_obj in next_state.health.values():
            next_h = health_obj.health  # current health
        score_change = next_state.score - curr_state.score - (next_h - curr_h) * 1.2

        child = Node(
            parent=node,
            act=GUAction.WAIT,
            state=next_state,
            cost=node.cost + (-score_change) + 6
        )
        yield child

        # Try PICK_UP action
        for entity_id in curr_state.collectible.keys():
            entity_pos = curr_state.position[entity_id]
            check_pos = (entity_pos.x, entity_pos.y)
            reward = 1
            key_pos = None
            for key_id in curr_state.key.keys():
                k_pos = curr_state.position.get(key_id)
                if k_pos:
                    key_pos = (k_pos.x, k_pos.y)
            if curr_pos == check_pos:
                if curr_pos == key_pos:
                    reward = 5
                next_state = step(curr_state, GUAction.PICK_UP, agent_id)
                for health_obj in next_state.health.values():
                    next_h = health_obj.health  # current health
                if next_state != curr_state:
                    score_change = next_state.score - curr_state.score - (next_h - curr_h) * 1.2
                    if (next_state.score - curr_state.score) > 0:
                        score_change = 0 - (next_h - curr_h) * 1.2

                    child = Node(
                        parent=node,
                        act=GUAction.PICK_UP,
                        state=next_state,
                        cost = node.cost + (-score_change) - reward
                    )

                    yield child
            
        # Try each action
        for (dx, dy), action in self.ACTION.items():
            # Get new state and calculate score difference
            if can_speed:
                dx += dx
                dy += dy
                new_x = curr_pos[0] + dx 
                new_y = curr_pos[1] + dy 
            else:
                new_x = curr_pos[0] + dx 
                new_y = curr_pos[1] + dy

            if not can_phase and self.is_blocked(curr_state, (new_x, new_y)):
                continue
            if not self.is_pushable(curr_state, (new_x, new_y), (dx, dy)):
                continue

            next_state = step(curr_state, action, agent_id)
            for health_obj in next_state.health.values():
                next_h = health_obj.health  # current health

            score_change = next_state.score - curr_state.score - (next_h - curr_h) * 1.2

            child = Node(
                parent=node,
                act=action, 
                state=next_state,
                cost = node.cost + (-score_change) + 5
            )
            yield child
            

    def astar_search(self, level_or_state, start: Tuple[int,int], goal: Tuple[int,int], search_end: bool) -> Optional[List[GUAction]]:
        initial = to_state(level_or_state) if isinstance(level_or_state, Level) else level_or_state
        reached = {}
        frontier = PriorityQueue()
        agent_id = next(iter(initial.agent.keys()))
        curr = Node(parent=None,
                    act=None,
                    state=initial,
                    cost=0
                )
        ALPHA = 1.2
        frontier.push(0 + self.manhattan(start, goal), curr)
        solution = []

        while len(frontier) > 0:
            curr = frontier.pop()
            start = self.get_agent_position_from_state_repr(curr.state)
            agent_inv = curr.state.inventory.get(agent_id)
            inv = frozenset(agent_inv.item_ids) if agent_inv else frozenset()
            boxes = self.get_box_positions(curr.state)
            enemies = self.get_enemy_positions(curr.state)
            powerup_obj = self.powerup_stats(curr.state)
            powerup = frozenset(powerup_obj) if powerup_obj else frozenset()
            end = goal
            state_key = (start, inv, boxes, enemies, powerup)
            if curr.state.win:
                while curr.parent:
                    solution.append(curr.act)
                    curr = curr.parent
                solution.reverse()
                
                return solution
            elif not search_end and start == end:
                while curr.parent:
                    solution.append(curr.act)
                    curr = curr.parent
                solution.reverse()
                
                return solution
            # Skip if we've seen this state with equal or better cost
            if state_key in reached:
                if curr.act == GUAction.USE_KEY:
                    pass  # Don't skip
                elif curr.cost >= reached[state_key]:
                    continue
            
            reached[state_key] = curr.cost
            
            for i in self.expand(curr.state, curr):
                
                child_pos = self.get_agent_position_from_state_repr(i.state)
                child_inv = i.state.inventory[agent_id]
                if i.state.lose:
                    continue
                inv = frozenset(child_inv.item_ids) if child_inv else frozenset()
                powerup_obj = self.powerup_stats(i.state)
                powerup = frozenset(powerup_obj) if powerup_obj else frozenset()
                boxes = self.get_box_positions(i.state)
                enemies = self.get_enemy_positions(i.state)
                child_key = (child_pos, inv, boxes, enemies, powerup)
                # Only add if not reached OR found better path
                if child_key not in reached or (i.cost < reached[child_key] and i.act != GUAction.WAIT) or i.act == GUAction.USE_KEY:
                    f = i.cost + self.manhattan(child_pos, end) * ALPHA
                    frontier.push(f, i)
        return None
  
